INSERT INTO `events` (`id`, `name`, `artist_id`, `description`, `venue_id`, `slug`, `image`, `event_time`, `event_time_info`, `created_at`) VALUES
(1, '1-800 TOUR', 1, '**Taco Hemingway ‚Äì 1-800 TOUR w Warszawie! Kup bilety na wyjƒÖtkowy koncert!**\nJu≈º 22 czerwca 2024 roku Taco Hemingway wystƒÖpi na PGE Narodowym w Warszawie w ramach swojej spektakularnej trasy **1-800 TOUR**! To wyjƒÖtkowe wydarzenie promuje jego najnowszy album _1-800-O≈öWIECENIE_ i zapowiada siƒô jako jeden z najwiƒôkszych koncert√≥w w karierze artysty.\n\nFani mogƒÖ spodziewaƒá siƒô nie tylko najwiƒôkszych hit√≥w, ale tak≈ºe wyjƒÖtkowej oprawy wizualnej i muzycznych niespodzianek. Na scenie pojawiƒÖ siƒô r√≥wnie≈º go≈õcie specjalni, kt√≥rzy dodadzƒÖ temu wieczorowi jeszcze wiƒôcej emocji!\n\nNie przegap szansy na udzia≈Ç w tym historycznym wydarzeniu! Bilety sƒÖ dostƒôpne w sprzeda≈ºy ‚Äì zarezerwuj swoje miejsce ju≈º teraz i bƒÖd≈∫ czƒô≈õciƒÖ niezapomnianego koncertu Taco Hemingwaya na PGE Narodowym!\n', 1, '1-800-tour', 'taco-post.jpg', '22.06.2024 20:00', '19:00 - Otwarcie bram <br>\r\n20:00 - Rozpoczƒôcie wydarzenia', '2025-04-03 18:26:13'),
(2, '2115 na Narodowym', 2, '## **2115 ‚Äì koncert na PGE Narodowym! Kup bilety na najwiƒôksze wydarzenie w historii polskiego hip-hopu!**\r\n\r\nJu≈º **12 lipca 2025 roku** grupa **2115** wystƒÖpi na PGE Narodowym w Warszawie! To bƒôdzie pierwszy w historii pe≈Çnowymiarowy koncert tej ekipy na stadionie ‚Äì z monumentalnƒÖ scenƒÖ, pirotechnikƒÖ i niezapomnianƒÖ oprawƒÖ wizualnƒÖ.\r\n\r\nNa scenie pojawiƒÖ siƒô:\r\n\r\n* **Bedoes 2115**\r\n* **White 2115**\r\n* **Bia≈Ças**\r\n* **Kubi Producent**\r\n* oraz **go≈õcie specjalni** (og≈Çoszeni wkr√≥tce!)\r\n\r\nFani mogƒÖ spodziewaƒá siƒô premierowych utwor√≥w, najwiƒôkszych hit√≥w 2115, ekskluzywnego merchu i widowiska, kt√≥re na d≈Çugo pozostanie w pamiƒôci.\r\n\r\n---\r\n\r\n### üéüÔ∏è **Bilety:**\r\n\r\n* Przedsprzeda≈º: od **15 marca 2025**\r\n* Oficjalna sprzeda≈º: od **20 marca 2025**\r\n* Dostƒôpne pule: **Trybuny**, **P≈Çyta**, **Golden Circle**, **VIP**\r\n\r\n---\r\n\r\nNie przegap tego wieczoru ‚Äì zarezerwuj bilety ju≈º teraz i do≈ÇƒÖcz do muzycznego ≈õwiƒôta 2115 na PGE Narodowym!\r\n\r\n> ‚ÄûM√≥wiƒÖ, ≈ºe marzenia siƒô nie spe≈ÇniajƒÖ. Ale my na to odpowiadamy: **2115 zrobi to po swojemu.**‚Äù\r\n', 1, '2115-na-narodowym', '2115.jpg', '12.07.2025 21:15', '20:15 - Otwarcie bram <br>\r\n21:15 - Rozpoczƒôcie wydarzenia', '2025-04-11 19:04:02');
