INSERT INTO `site_config` (`name`, `value`) VALUES
('about_content', '# **O NAS**  \r\n\r\n## üéü **Biletowo ‚Äì Twoje centrum wydarze≈Ñ!**  \r\n\r\nWitaj na **Biletowo** ‚Äì miejscu, gdzie pasja do kultury, muzyki i rozrywki ≈ÇƒÖczy siƒô z nowoczesnƒÖ technologiƒÖ! Nasza platforma powsta≈Ça z my≈õlƒÖ o wszystkich, kt√≥rzy kochajƒÖ koncerty, festiwale, spektakle teatralne, wydarzenia sportowe i inne eventy.  \r\n\r\nNaszym celem jest u≈Çatwienie dostƒôpu do najlepszych wydarze≈Ñ ‚Äì bez kolejek, bez stresu i w zaledwie kilka klikniƒôƒá. Dziƒôki **intuicyjnej wyszukiwarce** oraz **bezpiecznym metodom p≈Çatno≈õci**, mo≈ºesz zarezerwowaƒá bilet szybko i wygodnie, gdziekolwiek jeste≈õ.  \r\n\r\n## üéØ **Dlaczego warto wybraƒá Biletowo?**  \r\n\r\n‚úÖ **Szeroka oferta wydarze≈Ñ** ‚Äì koncerty, teatr, stand-up, imprezy sportowe i wiele wiƒôcej!  \r\n‚úÖ **≈Åatwy i szybki zakup** ‚Äì kupuj bilety w kilka minut, bez wychodzenia z domu.  \r\n‚úÖ **Bezpiecze≈Ñstwo transakcji** ‚Äì korzystamy z najlepszych system√≥w p≈Çatno≈õci online.  \r\n‚úÖ **Powiadomienia o nowych wydarzeniach** ‚Äì bƒÖd≈∫ na bie≈ºƒÖco z nadchodzƒÖcymi eventami.  \r\n‚úÖ **Obs≈Çuga klienta na najwy≈ºszym poziomie** ‚Äì zawsze chƒôtnie Ci pomo≈ºemy!  \r\n\r\nüì© Masz pytania? Skontaktuj siƒô z nami na **kontakt@biletowo.pl**  '),
('baner_image', 'taco-baner.jpg'),
