('faq_content', '# **FAQ ‚Äì NAJCZƒò≈öCIEJ ZADAWANE PYTANIA**  \r\n\r\n## **Jak kupiƒá bilet?**  \r\n1Ô∏è‚É£ Wybierz wydarzenie, na kt√≥re chcesz siƒô wybraƒá.  \r\n2Ô∏è‚É£ Dodaj bilety do koszyka.  \r\n3Ô∏è‚É£ Dokonaj p≈Çatno≈õci online.  \r\n4Ô∏è‚É£ Otrzymasz e-mail z biletem elektronicznym.  \r\n\r\n## **Jakie sƒÖ metody p≈Çatno≈õci?**  \r\n‚úî Karta p≈Çatnicza (Visa, Mastercard)  \r\n‚úî BLIK  \r\n‚úî Szybkie przelewy internetowe  \r\n\r\n## **Czy mogƒô zwr√≥ciƒá bilet?**  \r\nZwrot biletu jest mo≈ºliwy tylko w przypadku odwo≈Çania wydarzenia.  \r\n\r\n## **Nie otrzyma≈Çem biletu ‚Äì co robiƒá?**  \r\nüìå Sprawd≈∫ folder SPAM w swojej skrzynce e-mail.  \r\nüìå Je≈õli biletu nadal nie ma, skontaktuj siƒô z nami pod adresem **kontakt@biletowo.pl**.  \r\n\r\n## **Czy mogƒô zmieniƒá dane na bilecie?**  \r\nW niekt√≥rych przypadkach organizatorzy pozwalajƒÖ na zmianƒô danych. Skontaktuj siƒô z nami, aby sprawdziƒá dostƒôpne opcje.  \r\n\r\n## **Czy moje dane sƒÖ bezpieczne?**  \r\nTak! Stosujemy nowoczesne technologie szyfrowania i zabezpiecze≈Ñ, aby chroniƒá Twoje dane.  '),
('kontakt_content', '# **KONTAKT**  \r\n\r\n## üìû **Skontaktuj siƒô z nami!**  \r\n\r\nMasz pytania dotyczƒÖce zakupu bilet√≥w? Napotka≈Çe≈õ problem z zam√≥wieniem? A mo≈ºe chcesz dowiedzieƒá siƒô wiƒôcej o nadchodzƒÖcych wydarzeniach? Nasz **zesp√≥≈Ç obs≈Çugi klienta** jest gotowy, aby Ci pom√≥c!  \r\n\r\nüìß **E-mail:** kontakt@biletowo.pl  \r\nüìû **Telefon:** +48 123 456 789  \r\nüìç **Adres biura:** ul. Kulturalna 10, 00-001 Warszawa  \r\nüïí **Godziny pracy:** Poniedzia≈Çek ‚Äì PiƒÖtek, 9:00 ‚Äì 18:00  \r\n\r\nMo≈ºesz r√≥wnie≈º skorzystaƒá z **formularza kontaktowego** na naszej stronie ‚Äì odpowiemy najszybciej, jak to mo≈ºliwe! '),
('metody-platnosci_content', '# **Metody p≈Çatno≈õci**  \r\n\r\n## üí≥ **Jak mogƒô zap≈Çaciƒá za bilety?**  \r\nW Biletowo zapewniamy bezpieczne p≈Çatno≈õci online. Dostƒôpne metody to:  \r\n\r\n‚úî **Karty p≈Çatnicze** ‚Äì Visa, Mastercard, Maestro  \r\n‚úî **BLIK** ‚Äì szybkie p≈Çatno≈õci mobilne  \r\n‚úî **Przelewy online** ‚Äì obs≈Çugiwane przez system PayU  \r\n\r\n## ‚ö† **P≈Çatno≈õƒá nie powiod≈Ça siƒô ‚Äì co robiƒá?**  \r\n- Upewnij siƒô, ≈ºe masz wystarczajƒÖce ≈õrodki na koncie.  \r\n- Sprawd≈∫, czy karta jest aktywna i obs≈Çuguje p≈Çatno≈õci internetowe.  \r\n- Spr√≥buj ponownie lub skorzystaj z innej metody p≈Çatno≈õci.  \r\n\r\nJe≈õli nadal masz problem, skontaktuj siƒô z nami: **[kontakt@biletowo.pl](#)**  '),
('polityka-prywatnosci_content', '# **POLITYKA PRYWATNO≈öCI**  \r\n\r\n## **1. Postanowienia og√≥lne**  \r\n1.1. Niniejsza **Polityka Prywatno≈õci** okre≈õla zasady przetwarzania, przechowywania i ochrony danych osobowych u≈ºytkownik√≥w korzystajƒÖcych z serwisu **Biletowo** dostƒôpnego pod adresem [www.biletowo.pl](#).  \r\n1.2. Administratorem danych osobowych jest **Biletowo Sp. z o.o.**, z siedzibƒÖ przy ul. Kulturalnej 10, 00-001 Warszawa, wpisana do Krajowego Rejestru SƒÖdowego pod numerem KRS: 0000000000, NIP: 0000000000, REGON: 000000000.  \r\n1.3. Wszelkie dzia≈Çania zwiƒÖzane z przetwarzaniem danych osobowych sƒÖ zgodne z obowiƒÖzujƒÖcymi przepisami, w tym z **RozporzƒÖdzeniem Parlamentu Europejskiego i Rady (UE) 2016/679 (RODO)** oraz ustawƒÖ o ochronie danych osobowych.  \r\n\r\n## **2. Jakie dane zbieramy?**  \r\nPodczas korzystania z naszego serwisu zbieramy nastƒôpujƒÖce dane osobowe:  \r\n- **Podstawowe dane u≈ºytkownika:** imiƒô, nazwisko, adres e-mail, numer telefonu, adres zamieszkania (w przypadku zam√≥wie≈Ñ wymagajƒÖcych wysy≈Çki).  \r\n- **Dane p≈Çatnicze:** informacje o transakcjach, nr rachunku bankowego (przy zwrotach), nie przechowujemy danych kart p≈Çatniczych ‚Äì sƒÖ one przetwarzane przez zewnƒôtrznych operator√≥w p≈Çatno≈õci (np. PayU, Przelewy24).  \r\n- **Dane techniczne:** adres IP, typ urzƒÖdzenia, system operacyjny, przeglƒÖdarka internetowa.  \r\n\r\n## **3. Cel przetwarzania danych**  \r\nTwoje dane przetwarzamy w nastƒôpujƒÖcych celach:  \r\n‚úÖ **Realizacja zam√≥wienia** ‚Äì umo≈ºliwienie zakupu bilet√≥w i ich dostarczenie.  \r\n‚úÖ **Obs≈Çuga klienta** ‚Äì udzielanie odpowiedzi na pytania, rozwiƒÖzywanie problem√≥w z zam√≥wieniami.  \r\n‚úÖ **Marketing i newslettery** ‚Äì je≈õli wyrazisz zgodƒô, mo≈ºemy przesy≈Çaƒá Ci informacje o nadchodzƒÖcych wydarzeniach.  \r\n‚úÖ **Bezpiecze≈Ñstwo serwisu** ‚Äì zapobieganie nadu≈ºyciom, analiza ruchu na stronie.  \r\n\r\n## **4. Przechowywanie danych**  \r\nTwoje dane osobowe przechowujemy przez okres niezbƒôdny do realizacji cel√≥w, w jakich zosta≈Çy zgromadzone:  \r\n- Dane transakcyjne ‚Äì przez 5 lat (zgodnie z wymogami podatkowymi).  \r\n- Dane u≈ºytkownika ‚Äì do momentu usuniƒôcia konta lub cofniƒôcia zgody.  \r\n\r\n## **5. Udostƒôpnianie danych**  \r\nTwoje dane mogƒÖ byƒá przekazywane:  \r\n- Operatorom p≈Çatno≈õci w celu realizacji p≈Çatno≈õci.  \r\n- Organizatorom wydarze≈Ñ (je≈õli wymaga tego organizacja wydarzenia).  \r\n- Firmom kurierskim (je≈õli wysy≈Çka bilet√≥w odbywa siƒô drogƒÖ pocztowƒÖ).  \r\n- Organom ≈õcigania, je≈õli wymaga tego prawo.  \r\n\r\n## **6. Twoje prawa**  \r\nMasz prawo do:  \r\nüîπ **Dostƒôpu do swoich danych** ‚Äì mo≈ºesz sprawdziƒá, jakie informacje przechowujemy.  \r\nüîπ **Sprostowania danych** ‚Äì je≈õli sƒÖ b≈Çƒôdne lub nieaktualne.  \r\nüîπ **Usuniƒôcia danych** ‚Äì mo≈ºesz za≈ºƒÖdaƒá usuniƒôcia swoich danych, je≈õli nie sƒÖ ju≈º potrzebne.  \r\nüîπ **Ograniczenia przetwarzania** ‚Äì je≈õli chcesz wstrzymaƒá przetwarzanie danych w okre≈õlonych sytuacjach.  \r\nüîπ **Przenoszenia danych** ‚Äì mo≈ºesz za≈ºƒÖdaƒá przekazania swoich danych do innego administratora.  \r\nüîπ **Z≈Ço≈ºenia skargi** ‚Äì je≈õli uznasz, ≈ºe Twoje dane sƒÖ przetwarzane niezgodnie z prawem, mo≈ºesz skontaktowaƒá siƒô z **Urzƒôdem Ochrony Danych Osobowych (UODO)**.  \r\n\r\n## **7. Pliki cookies**  \r\nNasza strona korzysta z plik√≥w **cookies** w celu poprawy jako≈õci us≈Çug. Mo≈ºesz zmieniƒá ustawienia cookies w swojej przeglƒÖdarce.  \r\n\r\n## **8. Kontakt w sprawie ochrony danych**  \r\nW przypadku pyta≈Ñ dotyczƒÖcych ochrony danych osobowych skontaktuj siƒô z nami: **kontakt@biletowo.pl** '),
('regulamin_content', '# **REGULAMIN**  \r\n\r\n## **1. Postanowienia og√≥lne**  \r\n1.1. Regulamin okre≈õla zasady korzystania z serwisu **Biletowo**, w tym zasady zakupu bilet√≥w, zwrot√≥w i reklamacji.  \r\n1.2. Ka≈ºdy u≈ºytkownik zobowiƒÖzany jest do zapoznania siƒô z regulaminem przed dokonaniem zakupu.  \r\n\r\n## **2. Zakup bilet√≥w**  \r\n2.1. Zam√≥wienia mogƒÖ sk≈Çadaƒá osoby pe≈Çnoletnie oraz osoby niepe≈Çnoletnie za zgodƒÖ opiekuna prawnego.  \r\n2.2. P≈Çatno≈õƒá za bilety odbywa siƒô wy≈ÇƒÖcznie online.  \r\n2.3. Po dokonaniu p≈Çatno≈õci u≈ºytkownik otrzymuje e-mail z biletem elektronicznym.  \r\n\r\n## **3. Zwroty i reklamacje**  \r\n3.1. Zwrot biletu mo≈ºliwy jest wy≈ÇƒÖcznie w przypadku odwo≈Çania wydarzenia.  \r\n3.2. Reklamacje dotyczƒÖce zam√≥wienia nale≈ºy zg≈Çaszaƒá w ciƒÖgu 14 dni od daty zakupu.  \r\n3.3. Reklamacje rozpatrywane sƒÖ w ciƒÖgu 7 dni roboczych.  \r\n\r\n## **4. Postanowienia ko≈Ñcowe**  \r\n4.1. Administrator zastrzega sobie prawo do zmian w regulaminie.  \r\n4.2. W sprawach nieuregulowanych niniejszym regulaminem obowiƒÖzujƒÖ przepisy prawa polskiego.  '),
('wsparcie-klienta_content', '# **Wsparcie klienta**  \r\n\r\nMasz pytania dotyczƒÖce bilet√≥w, p≈Çatno≈õci lub wydarze≈Ñ? Nasz zesp√≥≈Ç jest gotowy do pomocy!  \r\n\r\nüìß **E-mail:** [kontakt@biletowo.pl](#)  \r\nüìû **Telefon:** +48 123 456 789  \r\nüìÖ **Godziny pracy:** Poniedzia≈Çek ‚Äì PiƒÖtek, 9:00 ‚Äì 18:00  \r\n\r\nüì© Mo≈ºesz tak≈ºe skorzystaƒá z **formularza kontaktowego**, a my odpowiemy najszybciej, jak to mo≈ºliwe.  \r\n\r\nüéü **Biletowo ‚Äì bo ka≈ºda chwila jest warta prze≈ºycia!**  '),
('zwroty-reklamacje_content', '# **Zwroty i reklamacje**  \r\n\r\n## üîÑ **Czy mogƒô zwr√≥ciƒá bilet?**  \r\nZwrot biletu jest mo≈ºliwy **tylko w przypadku odwo≈Çania wydarzenia** przez organizatora. Je≈õli wydarzenie zostanie prze≈Ço≈ºone, Tw√≥j bilet zachowuje wa≈ºno≈õƒá na nowƒÖ datƒô.  \r\n\r\n## ‚ö† **Bilet nie dzia≈Ça?**  \r\nJe≈õli Tw√≥j bilet nie dzia≈Ça lub nie otrzyma≈Çe≈õ go na e-mail, sprawd≈∫ folder **SPAM**. Je≈õli nadal masz problem, skontaktuj siƒô z nami:  \r\n\r\nüìß **E-mail:** [kontakt@biletowo.pl](#)  \r\nüìû **Telefon:** +48 123 456 789  \r\n\r\n## üìå **Jak zg≈Çosiƒá reklamacjƒô?**  \r\nJe≈õli masz problem z biletem lub p≈Çatno≈õciƒÖ, wype≈Çnij **formularz reklamacyjny** dostƒôpny na stronie. Odpowiemy w ciƒÖgu **48 godzin roboczych**. ');
